import React from 'react'
import Col from 'react-bootstrap/Col';
import ImgNav from './ImgNav';
import CabNav from './CabNav';

export default function ImgCarousel (props) {
    console.log(props.images)
    return (
        <Col lg='8' md='8'>
            <img src={props.images[0]} />
            <ImgNav />
            <CabNav />
        </Col>
    )
}
